import React, {useEffect,useState} from "react";
import {
  Table,
  TableRow,
  TableHead,
  TableBody,
  TableCell,
  Chip
} from "@material-ui/core";
import useStyles from "../../styles";

// Change status here to indicate if a we are over or under threshold
const states = {
  live: "success",
  development: "warning",
  requirements: "secondary",
};

export default function TableComponent({ data }) {
  const classes = useStyles();
  var keys = Object.keys(data[0]).map(i => 
    // formatting credit score column name
    (i === 'creditScore'? i = "CREDIT SCORE":i.toUpperCase()));
  keys.shift(); // delete "id" key
  return (
    <Table className="mb-0">
      <TableHead>
        <TableRow>
          {keys.map(key => (
            <TableCell key={key}>{key}</TableCell>
          ))}
        </TableRow>
      </TableHead>
      <TableBody>
        {data.map(({ id,first, middle, last, address,city,state,	zip,dob,ssn,phone,creditScore }) => (
          <TableRow hover={true} key={id}>
            <TableCell align={right}>{first}</TableCell>
            <TableCell>{middle}</TableCell>
            <TableCell>{last}</TableCell>
            <TableCell>{address}</TableCell>
            <TableCell>{city}</TableCell>
            <TableCell>{state}</TableCell>
            <TableCell>{zip}</TableCell>
            <TableCell>{dob}</TableCell>
            <TableCell>{ssn}</TableCell>
            <TableCell>{phone}</TableCell>
            <TableCell>{creditScore}</TableCell>
          </TableRow>
        ))}
      </TableBody>
    </Table>
  );
}
